import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";

const Login = () => {
        const [email, setEmail] = useState("");
        const [password, setPassword] = useState("");
        const [error, setError] = useState("");
        const [loading, setLoading] = useState(false);
        const navigate = useNavigate();

        const handleSubmit = async (e) => {
                e.preventDefault();
                setLoading(true);
                setError("");

                try {
                        const response = await fetch("http://localhost:5000/api/users/login", {
                                method: "POST",
                                headers: { "Content-Type": "application/json" },
                                body: JSON.stringify({ email, password }),
                        });

                        const data = await response.json();

                        if (response.ok) {
                                localStorage.setItem("userId", data.user.id);
                                localStorage.setItem("userToken", data.user.token); // âœ… Fix: Ensure token is stored
                                window.dispatchEvent(new Event("storage")); // âœ… Fix: Notify auth state update
                                navigate("/"); // âœ… Redirect user after login
                        } else {
                                setError(data.message || "Invalid credentials");
                        }
                } catch (err) {
                        setError("Server error");
                } finally {
                        setLoading(false);
                }
        };


        return (
                <div className="flex items-center justify-center min-h-screen bg-[#F5ECE3]">

                        {/* Floating Decorative Elements */}
                        <div className="absolute top-10 left-10 w-24 h-24 bg-[#B88E8D] rounded-full opacity-30"></div>
                        <div className="absolute bottom-16 right-16 w-32 h-32 bg-[#D8B6A4] rounded-full opacity-20"></div>

                        <div className="w-full max-w-lg bg-white shadow-xl rounded-3xl p-8 border border-[#D8B6A4] flex flex-col items-center">
                                <h2 className="text-3xl font-bold text-[#B88E8D] mb-2">Welcome Back</h2>
                                <p className="text-gray-600 text-center mb-6">Sign in to continue</p>

                                <form className="w-full space-y-4" onSubmit={handleSubmit}>
                                        <div className="w-full">
                                                <label className="block text-gray-600 text-sm mb-1">Email</label>
                                                <div className="relative">
                                                        <input
                                                                type="email"
                                                                onChange={(e) => setEmail(e.target.value)}
                                                                className="w-full p-4 pl-12 border border-[#D8B6A4] bg-[#FAF5F0] rounded-lg shadow-sm focus:outline-none focus:ring-2 focus:ring-[#B88E8D]"
                                                                placeholder="Enter your email"
                                                                required
                                                        />
                                                        <span className="absolute left-4 top-1/2 transform -translate-y-1/2 text-[#B88E8D]">ðŸ“§</span>
                                                </div>
                                        </div>

                                        <div className="w-full">
                                                <label className="block text-gray-600 text-sm mb-1">Password</label>
                                                <div className="relative">
                                                        <input
                                                                type="password"
                                                                onChange={(e) => setPassword(e.target.value)}
                                                                className="w-full p-4 pl-12 border border-[#D8B6A4] bg-[#FAF5F0] rounded-lg shadow-sm focus:outline-none focus:ring-2 focus:ring-[#B88E8D]"
                                                                placeholder="Enter your password"
                                                                required
                                                        />
                                                        <span className="absolute left-4 top-1/2 transform -translate-y-1/2 text-[#B88E8D]">ðŸ”’</span>
                                                </div>
                                        </div>

                                        {error && <p className="text-red-500 text-sm text-center">{error}</p>}

                                        <div className="flex justify-between text-sm w-full">
                                                <label className="flex items-center space-x-2 text-gray-600">
                                                        <input type="checkbox" className="accent-[#B88E8D]" />
                                                        <span>Remember me</span>
                                                </label>
                                                <Link to="/ForgotPassword" className="text-[#B88E8D] hover:underline">
                                                        Forgot password?
                                                </Link>
                                        </div>

                                        <button
                                                type="submit"
                                                className="w-full bg-[#B88E8D] text-white font-semibold py-3 rounded-lg shadow-md hover:bg-[#A17A7A] transition duration-300"
                                                disabled={loading}
                                        >
                                                {loading ? "Logging in..." : "Login"}
                                        </button>
                                </form>

                                <p className="text-center text-gray-600 text-sm mt-4">
                                        Don't have an account?{" "}
                                        <Link to="/signup" className="text-[#B88E8D] hover:underline">
                                                Sign up
                                        </Link>
                                </p>
                        </div>
                </div>

        );
};

export default Login;
